import React, { useEffect, useState } from "react";
import axios from "axios";

export default function AdminDashboard() {
  const [orders, setOrders] = useState([]);
  const [inventory, setInventory] = useState([]);

  const token = localStorage.getItem("token");

  useEffect(() => {
    fetchOrders();
    fetchInventory();
  }, []);

  const fetchOrders = async () => {
    const res = await axios.get("http://localhost:5000/api/orders/admin/orders", {
      headers: { Authorization: `Bearer ${token}` },
    });
    setOrders(res.data);
  };

  const fetchInventory = async () => {
    const res = await axios.get("http://localhost:5000/api/inventory/admin/inventory", {
      headers: { Authorization: `Bearer ${token}` },
    });
    setInventory(res.data);
  };

  const updateStatus = async (id, status) => {
    await axios.put(
      `http://localhost:5000/api/orders/admin/update-status/${id}`,
      { status },
      { headers: { Authorization: `Bearer ${token}` } }
    );
    fetchOrders();
  };

  const updateInventory = async (id, qty) => {
    await axios.put(
      `http://localhost:5000/api/inventory/admin/inventory/${id}`,
      { qty },
      { headers: { Authorization: `Bearer ${token}` } }
    );
    fetchInventory();
  };

  return (
    <div className="admin-dashboard" style={{ padding: "20px", minHeight: "100vh", color: "white" }}>
      <h1>Admin Dashboard</h1>

      {/* Orders Section */}
      <h2>All Orders</h2>
      <table border="1" cellPadding="10" style={{ background: "rgba(0,0,0,0.6)", color: "white" }}>
        <thead>
          <tr>
            <th>Order ID</th>
            <th>User</th>
            <th>Items</th>
            <th>Total Price</th>
            <th>Status</th>
            <th>Update Status</th>
          </tr>
        </thead>
        <tbody>
          {orders.map((order) => (
            <tr key={order._id}>
              <td>{order._id}</td>
              <td>{order.user?.email || "Guest"}</td>
              <td>
                {order.items.map((item, i) => (
                  <div key={i}>{item.name}</div>
                ))}
              </td>
              <td>₹{order.totalPrice}</td>
              <td>{order.status}</td>
              <td>
                <select value={order.status} onChange={(e) => updateStatus(order._id, e.target.value)}>
                  <option value="Processing">Processing</option>
                  <option value="Out for Delivery">Out for Delivery</option>
                  <option value="Delivered">Delivered</option>
                </select>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Inventory Section */}
      <h2 style={{ marginTop: "40px" }}>Inventory Management</h2>
      <table border="1" cellPadding="10" style={{ background: "rgba(0,0,0,0.6)", color: "white" }}>
        <thead>
          <tr>
            <th>Category</th>
            <th>Name</th>
            <th>Price</th>
            <th>Qty</th>
            <th>Update Qty</th>
          </tr>
        </thead>
        <tbody>
          {inventory.map((item) => (
            <tr key={item._id}>
              <td>{item.category}</td>
              <td>{item.name}</td>
              <td>₹{item.price}</td>
              <td style={{ color: item.qty < 20 ? "red" : "white" }}>{item.qty}</td>
              <td>
                <input
                  type="number"
                  defaultValue={item.qty}
                  onBlur={(e) => updateInventory(item._id, e.target.value)}
                />
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
